package com.github.jmetzz.challenges.algorithms.strings;

import com.github.jmetzz.challenges.algorithms.strings.buildString.KMPBased;
import com.github.jmetzz.challenges.algorithms.strings.buildString.LexicalTreeBased;
import com.github.jmetzz.challenges.algorithms.strings.buildString.StringComparisonBased;
import org.junit.Test;
import org.junit.runner.RunWith;
import org.junit.runners.Parameterized;

import java.util.Arrays;
import java.util.Collection;

import static org.junit.Assert.assertEquals;

@RunWith(Parameterized.class)
public class StringConstruction_3Test {

    private String input;
    private int expected;
    private int priceA;
    private int priceB;


    public StringConstruction_3Test(String input, Integer expected, Integer priceA, Integer priceB) {
        this.input = input;
        this.expected = expected;
        this.priceA = priceA;
        this.priceB = priceB;
    }

    @Parameterized.Parameters
    public static Collection<Object[]> data() {
        return Arrays.asList(new Object[][]{
{"", 677051, 6044, 6047},
                {"", 3285681, 8832, 8833},
                {"", 35377148, 4739, 4743},

                {"caacctinbnatinbnaqaacctinbnatinbnainbnatigaeifcaac", 29, 1, 3},
                {"bbaakbbabaptakbbabaptafbbabbaakbbabapcqkmbbabaptak", 50, 2, 4},
                {"cbbcnkbbcbnkbbcbtnkatnbebgcbnkbgbcnkbbcbnkmbndnknk", 50, 2, 2}
        });
    }

    //    @Before
    public void warmup() {
        StringComparisonBased generator = new StringComparisonBased();
        for (int i = 0; i < 20; i++)
            generator.costToGenerate(input, priceA, priceB);
    }


    //    @Test
    public void testKMPBased() {
        assertEquals(expected, new KMPBased().costToGenerate(input, priceA, priceB));
    }

    @Test
    public void testLexicalTreeBased() {
        assertEquals(expected, new LexicalTreeBased().costToGenerate(input, priceA, priceB));
    }
}